import React from 'react';
import './Header.css';

function Header() {

  return (
    <div className="header">    
      <div className="header-logo"><span>Visualizer</span></div>
      <div className="header__options"> 
        <ul>
          <li>Sorting</li>
          <li>Searching</li>
          </ul>        
      </div>
   </div>
  )
}

export default Header;
